const Form = (props) => {

  const theme = createTheme({
    components: {
      // Name of the component
      MuiButton: {
        styleOverrides: {
          // Name of the slot
          root: {
            // Some CSS
            fontSize: '1rem',
          },
        },
      },
    },
  });

  return (
      <form>
        <Input size='medium' placeholder='Add a task'/>
      </form>
  );
}

export default Form;
